import React from "react";
import NotesList from "./notesList"; // Import Twojego istniejącego komponentu

function NotesPage() {
  return (
    <div className="container">
      <h1 className="page-title">Moje Notatki</h1>
      <NotesList /> {/* Wyświetlamy komponent NotesList */}
    </div>
  );
}

export default NotesPage;
